import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import api from '../../services/api';
import { toast } from 'react-toastify';
import './LawyerList.css';

function LawyerList() {
  const { user } = useAuth();
  const [lawyers, setLawyers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchLawyers();
  }, []);

  const fetchLawyers = async () => {
    try {
      const response = await api.get('/lawyers?limit=1000');
      setLawyers(response.data.data || []);
    } catch (error) {
      console.error('Error fetching lawyers:', error);
      console.error('Response data:', error.response?.data);
      console.error('Response status:', error.response?.status);
      const errorMsg = error.response?.data?.message || 'Error fetching lawyers';
      toast.error(errorMsg);
    } finally {
      setLoading(false);
    }
  };

  const handleVerify = async (lawyerId, currentStatus) => {
    try {
      const response = await api.put(`/lawyers/${lawyerId}`, {
        verified: !currentStatus,
        update_description: `Profile ${!currentStatus ? 'verified' : 'unverified'}`
      });
      toast.success('Verification status updated');
      fetchLawyers();
    } catch (error) {
      toast.error('Error updating verification status');
    }
  };

  if (loading) {
    return <div className="container"><div className="loading">Loading...</div></div>;
  }

  return (
    <div className="container">
      <div className="page-header">
        <h1>Lawyer Profiles</h1>
        {user?.role === 'ADMIN' && (
          <Link to="/lawyers/new" className="btn btn-primary">
            Add New Lawyer
          </Link>
        )}
      </div>

      <div className="card">
        <table className="table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Provider Type</th>
              <th>License Status</th>
              <th>Verified</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {lawyers.map(lawyer => (
              <tr key={lawyer.lawyer_id}>
                <td>{lawyer.name}</td>
                <td>{lawyer.provider_type}</td>
                <td>
                  {lawyer.license_status && (
                    <span className={`badge ${lawyer.license_status === 'ACTIVE' ? 'badge-success' : 'badge-danger'}`}>
                      {lawyer.license_status}
                    </span>
                  )}
                </td>
                <td>
                  {lawyer.verified ? (
                    <span className="badge badge-success">Yes</span>
                  ) : (
                    <span className="badge badge-warning">No</span>
                  )}
                </td>
                <td>{lawyer.email || 'N/A'}</td>
                <td>{lawyer.phone || 'N/A'}</td>
                <td>
                  <div className="action-buttons">
                    <Link
                      to={`/lawyers/${lawyer.lawyer_id}`}
                      className="btn btn-secondary"
                      style={{ marginRight: '5px', padding: '5px 10px', fontSize: '12px' }}
                    >
                      View
                    </Link>
                    {user?.role === 'ADMIN' && (
                      <>
                        <Link
                          to={`/lawyers/${lawyer.lawyer_id}/edit`}
                          className="btn btn-primary"
                          style={{ marginRight: '5px', padding: '5px 10px', fontSize: '12px' }}
                        >
                          Edit
                        </Link>
                        <button
                          onClick={() => handleVerify(lawyer.lawyer_id, lawyer.verified)}
                          className={`btn ${lawyer.verified ? 'btn-warning' : 'btn-success'}`}
                          style={{ padding: '5px 10px', fontSize: '12px' }}
                        >
                          {lawyer.verified ? 'Unverify' : 'Verify'}
                        </button>
                      </>
                    )}
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default LawyerList;
